import React from 'react';
// import logo from './logo.svg';
// import './App.css';
import NavbarSection from '../home/NavbarSection';
import { makeStyles } from '@material-ui/core/styles';
import Button from '@material-ui/core/Button';
import HomeBackgroundImage from '../../assets/img/home-background.png'
import '../../assets/css/home.css'
import BackgroundImage from "react-background-image";
import Grid from '@material-ui/core/Grid';
import Typography from '@material-ui/core/Typography';

const useStyles = makeStyles(theme => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
    },
  },
  backgroundImage: {
    width: '100%',
    position: 'absolute',
    backgroundBlendMode: 'luminosity',
    backgroundSize: 'cover',
    top: 0,
    left: 0,
    right: 0,
    bottom: 0,
    zIndex: -1,
  }
}));

export default function Home() {
  const classes = useStyles();

  return (
    <div>
      <img src={HomeBackgroundImage} className={classes.backgroundImage} alt='website background' />
      <NavbarSection />
      <img src={BackgroundImage} />
      <Grid container 
      display="flex"
      alignItems="flex-end">
        <Grid item xs={12} sm={6}>
          <Typography variant="h5" gutterBottom>
            h5. Heading </Typography>
        </Grid>
        <Grid item xs={12} sm={6}>

        </Grid>
      </Grid>
    </div>
  )
}
